                // off_obj.tel = resp.tel[i],
                // off_obj.points = resp.points[i],
                // off_obj.prize= resp.prize[i],
                // off_obj.ballots = resp.ballots[i]  
                // t = off_obj
            } 
            // if(i === resp.id.length){
            //     console.log(t)
            // }

        })
    },[])
    console.log(data_from_db)
  return(
    <div id='dash_Home'>
        <SideBar />
        <div id='content_holder'>
            <Header />
            <div id='content_wrapper'>
            <Cards />
            <div id='table_content'>
            <table> 
                <tr>
                    <th>Name</th>
                    <th>address</th>
                    <th>province</th>
                    <th>email</th>
                    <th>Tel</th>
                    <th>Points</th>
                    <th>Prize</th>
                    <th>Ballots</th>
                </tr>

                    {data_from_db.map((data, index)=>{
                            return(
                            <tr>
                            <td>{data.name}</td>
                            <td>{data.address}</td>
                            <td>{data.province}</td>
                            <td>{data.email}</td>
                            <td>{data.tel}</td>
                            <td>{data.points}</td>
                            <td>{data.prize}</td>
                            <td>{data.ballots}</td>
                            </tr>
                            )
                        })
                    }

            </table>
            </div>
            <Footer data={data_from_db}/>

            </div>

        </div>

    </div>
   )

 }

export default Home
